    productos = []
    met = async (e) =>{
        e.preventDefault()
        this.productos = await this.ProductoService.getProductos()
        console.log(this.productos)
    }
    
    render(){
        console.log('+++++++++++++++++++++')
        this.met()
        console.log('--------------------')
